import React, { useState } from 'react';
import RecommendationCard from './RecommendationCard';
import './PlanStyle.css';

const TripForm = () => {
  const [formData, setFormData] = useState({
    destination: '',
    startDate: '',
    endDate: '',
    tripType: '',
    budget: '',
  });
  const [recommendations, setRecommendations] = useState([]);

  const destinations = [
    { city: 'Abohar', state: 'Punjab', place: 'Nehru Park, Punjab', popularity: 'Medium', description: 'Urban park, recreational activities.', type: 'Nature', budget: 1000 },
    { city: 'Abohar', state: 'Punjab', place: 'Shri Hanuman Mandir', popularity: 'Medium', description: 'Hindu temple, religious rituals.', type: 'Spiritual', budget: 1500 },
    { city: 'Abohar', state: 'Punjab', place: 'Gurudwara Sri Guru Teg Bahadur Sahib Ji', popularity: 'Medium', description: 'Sikh gurdwara, religious rituals.', type: 'Spiritual', budget: 2000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Basar Saraswati Temple', popularity: 'Medium', description: 'Hindu temple, religious rituals.', type: 'Spiritual', budget: 1000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Pochera Waterfalls', popularity: 'Medium', description: 'Waterfall, scenic beauty.', type: 'Nature', budget: 1500 },
    { city: 'Adilabad', state: 'Telangana', place: 'Kuntala Waterfalls', popularity: 'Medium', description: 'Waterfall, natural beauty.', type: 'Nature', budget: 2000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Kuntala Waterfall', popularity: 'High', description: 'Spectacular waterfall, natural beauty.', type: 'Nature', budget: 1000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Jainath Temple', popularity: 'High', description: 'Hindu temple, architectural beauty.', type: 'Spiritual', budget: 1500 },
    { city: 'Adilabad', state: 'Telangana', place: 'Gudem Satyanarayana Swamy Temple', popularity: 'High', description: 'Hindu temple, religious rituals.', type: 'Spiritual', budget: 2000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Kadam Dam', popularity: 'High', description: 'Water reservoir, boating, and fishing.', type: 'Nature', budget: 1000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Sahastrakund Waterfalls', popularity: 'High', description: 'Spectacular waterfall, natural beauty.', type: 'Nature', budget: 1500 },
    { city: 'Adilabad', state: 'Telangana', place: 'Kala Ashram', popularity: 'High', description: 'Cultural center, traditional arts and crafts.', type: 'Unique', budget: 2000 },
    { city: 'Adilabad', state: 'Telangana', place: 'Sirpur Lake', popularity: 'High', description: 'Picnic spot, boating, and leisure.', type: 'Nature', budget: 1000 }
  ];

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const recommendTrips = (formData) => {
    return destinations.filter(destination => 
      (formData.tripType ? destination.type === formData.tripType : true) &&
      (formData.budget ? destination.budget <= formData.budget : true)
    );
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const recommendations = recommendTrips(formData);
    setRecommendations(recommendations);
    console.log('Form Data:', formData);
    console.log('Recommended Trips:', recommendations);
  };

  return (
    <div className="trip-form-container">
      <h2>Plan Your Next Adventure</h2>
      <p>Get started by filling out the form below:</p>
      <form onSubmit={handleSubmit}>
        <label>
          Destination
          <input
            type="text"
            name="destination"
            placeholder="Enter your Destination"
            value={formData.destination}
            onChange={handleChange}
          />
        </label>
        <div className="date-labels">
          <label>
            Start Date
            <input
              type="date"
              name="startDate"
              value={formData.startDate}
              onChange={handleChange}
            />
          </label>
          <label>
            End Date
            <input
              type="date"
              name="endDate"
              value={formData.endDate}
              onChange={handleChange}
            />
          </label>
        </div>
        <div className="date-labels">
          <label>
            Trip Type
            <select name="tripType" value={formData.tripType} onChange={handleChange}>
              <option value="">Select Type</option>
              <option value="Adventure">Adventure</option>
              <option value="Relaxation">Relaxation</option>
              <option value="Cultural">Cultural</option>
              <option value="Nature">Nature</option>
            </select>
          </label>
          <label>
            Budget
            <input
              type="number"
              name="budget"
              placeholder="Enter in Rs."
              value={formData.budget}
              onChange={handleChange}
            />
          </label>
        </div>
        <button type="submit">Create Trip</button>
      </form>
      <div className="recommendations">
        {recommendations.map((destination, index) => (
          <RecommendationCard key={index} destination={destination} />
        ))}
      </div>
    </div>
  );
};

export default TripForm;
